		var tmpA;
		var chart_svg = "";
		var svg2png = function (svg) {
		  var canvas = document.createElement('canvas'),
			  evt = document.createEvent('MouseEvent');

		  svg.setAttribute('xmlns', 'http://www.w3.org/2000/svg');
		  evt.initMouseEvent('click', true, true, window, 0, 0, 0, 0, 0,
							  false, false, false, false, 0, null);

		  canvg(canvas, (new XMLSerializer()).serializeToString(svg), {
			ignoreMouse: true,
			ignoreAnimation: true,
			renderCallback: function () {
				tmpA.href = canvas.toDataURL('image/png');
				if(navigator.userAgent.toLowerCase().match(/chrome/))
					tmpA.dispatchEvent(evt);
				else
					window.open(tmpA.href);
			}
		  });
		};
		
		var draw_chart = function(state){
			for(var i=1; i <= chart_list.length; i++)
			{
//				console.log(result[state][chart_list[i]]);
				$('#chart > #'+chart_list[i-1]).attr('width',parseFloat(342.66*result[state][i]));
			}
		}
		
		if($(".result_chart").length > 0) draw_chart("NSW");
		
		$('.result_chart .selectitem .selectState-menu > a').click(function () {
			$('.selectitem .selectState-menu ul > li').click(function () {
				$('#selectState-menu-button').html(this.innerHTML);
				$('#selectState')[0].value = this.innerHTML;
				
				$('#State > g').attr('display','none');
				$('#State > #'+this.innerHTML).attr('display','');
				draw_chart(this.innerHTML);
			});
		});
		
		$('#selectState-menu-button').click(function(){    
			$('.lp_state .dropdown-menu li').click(function(){
				$('#selectState-menu-button').html(this.innerHTML);
				$('#selectState')[0].value = this.innerHTML;
			});
		});
	});
